import React, { useEffect, useState } from "react";
import PlaylistComponent from "./Playlist/PlaylistComponent";

function DigitalProgramming() {

    const [playlists, setPlaylists] = useState({});
    const [isFetched, setIsFetched] = useState(false);

    async function fetchPlaylists() {
        if (isFetched === false) {
            fetch("http://localhost:3030/youtube/playlists")
                .then(res => res.json())
                .then((result) => {

                    setPlaylists(result);
                    setIsFetched(true);
                    console.log("I am here more often than i should.")
                }, (error) => {
                    throw Error(error);
                });
        }
    }
    const PlaylistComponent = playlists.map(playlist => {
        <PlaylistComponent data={playlist} key={playlist.id} />
    });
    // function ShowPlaylists({playlistsData})
    // {
    //     const playlistComponents = [];
        
    //     console.log(playlistsData);

    //     playlistComponents.forEach(element => {
    //         playlistComponents.push(<PlaylistComponent data={element} key={element.id} />)
    //     });
    //     return {playlistComponents};
    // }
    useEffect(() => {
        fetchPlaylists();
    }, [])

    if (isFetched) {
        return (
            <div className="DigitalProgramming">
                <h1> Digital Programming Page </h1>
                {PlaylistComponent}
            </div>
        );
    }
}

export default DigitalProgramming;
